import TopicBox from '../components/TopicBox'
import Content from '../components/Content'

export default function HomePage() {
  return (
    <div>
        <TopicBox num="1" letter="a"/>
        <TopicBox num="2" letter="b"/>
        <TopicBox num="3" letter="c"/>

        <Content/>
    </div>
  )
}
